Drew, AJ - A Wiccan Bible, 2003, 435 pages

Drew presents a logical, balanced view of Wicca, with Goddess and God representing complementary halves of a greater whole. The book is ordered into 3 logical sections, representing a natural progression of knowing which lends itself well to the practical side of the craft. Overall, an excellent introduction to the subject.


